import './App.css';
import NavBar from './client/components/NavBar';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={fantasy} className="App-logo" alt="logo" />
        <p>Welcome to Fantasy N' Chill</p>
        <span>
          A bunch of know it all fantasy football members who know nothing at
          all.
        </span>
        <a
          className="App-link"
          href="https://sleeper.com/leagues/863187571134541824/league"
          target="_blank"
          rel="noopener noreferrer"
        >
          Sleeper
        </a>
      </header>
      <NavBar />
    </div>
  );
}

export default App;
